import { Form } from 'antd'

const NewPost = () => {
    return(
        <h1>Create New Post here</h1>
    )
}

const PostList = () => {
    return (
        <h1>Posted Commodity List</h1>
    )
}


const PostCommodity = () => {
    return(
        <div>
            <NewPost />
            <PostList />
        </div>
    )
}

export default PostCommodity
